import React from 'react';
import './index.css';

import Netflix from './Netflix';
import Amazon from './Amazon';

const netseries = 'Netflix';

function App(){
    return (
        <React.Fragment>        
        <h1 className='heading_style'>The Top 5 Netflix Weberies</h1>
        { netseries === 'Netflix' ? <Netflix /> : <Amazon />}
      </React.Fragment>
    )
}

export default App;
